                mono.off(document.body, 'mouseenter', _this.onFrameMouseEnterBind);
                mono.off(document.body, 'mouseleave', _this.onFrameMouseLeaveBind);
                _this.onFrameMouseEnterBind = null;
                _this.onFrameMouseLeaveBind = null;
